import './Menu.css';
import { IconName } from "react-icons/fa";


function Menu() {

    return (
        <div className='Menu'>
            <div className='SousMenu'><FontAwesomeIcon icon={faHome} /></div>
            <div className='SousMenu'>Rechercher</div>
        </div>
    );
}

export default Menu;
